import React, { useContext } from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Products from './products/Products';
import Login from './auth/Login';
import Register from './auth/Register';
import Cart from './cart/Cart';
import NotFound from './untils/not_found/NotFound';
import DetailProduct from './products/detailProduct/DetailProduct';

import { GlobalState } from '../../GlobalState';

function Pages() {
    const { userAPI } = useContext(GlobalState);
    const { isLogged } = userAPI;

    return (
        <Routes>
            <Route path="/" element={<Products />} />
            <Route path="/login" element={isLogged ? <Navigate to="/" /> : <Login />} />
            <Route path="/register" element={isLogged ? <Navigate to="/" /> : <Register />} />
            <Route path="/cart" element={<Cart />} />
            <Route path="detail/:id" element={<DetailProduct/>}/>
            <Route path="*" element={<NotFound />} />
        </Routes>
    );
}

export default Pages;
